def test_parse_note1():
	xml = article1()
	frames = parse_enex_string( xml )
	frames = list( frames )
	assert len( frames ) == 1

	note: Note = frames[ 0 ].note
	assert note.title == "My Favorite Paradox - ForrestTheWoods"
	assert note.attributes.source_url.raw == "https://www.forrestthewoods.com/blog/my_favorite_paradox/#.474j5fb2b"
	assert note.attributes.source_application == "webclipper.evernote"
	assert note.attributes.source == "web.clip7"
	assert not list( note.resources )

	meta: StyleMetadata = frames[ 0 ].metadata.style
	assert meta.content_type == ClipType.BOOKMARK
	assert meta.content_source.raw == "https://www.forrestthewoods.com/blog/my_favorite_paradox/#.474j5fb2b"
	assert meta.content_title == "My Favorite Paradox - "


def test_parse_note2():
	xml = article2()
	frames = parse_enex_string( xml )
	frames = list( frames )
	assert len( frames ) == 1

	note: Note = frames[ 0 ].note

	assert note.title == '"Meander: Declarative Explorations at the Limits of FP" by Jimmy Miller - YouTube'
	assert len( list( note.resources ) ) == 1

	resource = note.resources[ 0 ]

	assert resource.mime == MimeType.JPEG
	assert resource.width == "480"
	assert resource.height == "360"
	assert resource.attributes.file_name == "hqdefault.jpg"
	assert resource.attributes.source_url.raw == 'en-cache://tokenKey%3D%22AuthToken%3AUser%3A219014403%22+0a5cd33c-1bac-4c91-98dc-f705234e3beb+5d364ec9a8ec212eccfba43bb0398c97+https://www.evernote' \
	                                             '.com/shard/s583/res/011092aa-b13e-47b1-ae3d-49a90f1e5a1b'


def test_parse_all():
	files = pathlib.Path( r"C:\Users\Mateus\Downloads" ).glob( "*.enex" )

	all_urls = [ ]
	not_urls = [ ]
	for file_name in files:
		frames = parse_enex_file( str( file_name ) )
		for frame in frames:
			source_url = frame.note.attributes.source_url
			if source_url:
				all_urls.append( source_url.raw )
			else:
				source = frame.note.attributes.source
				if not source:
					files = map( lambda x: x.attributes.file_name  , frame.note.resources)
					not_urls.extend(   files )

	print( len(not_urls))


test_parse_all()
